import axios from 'axios';
import React from 'react'


interface CardProps {
	title: string,
	paragraph: string
}

export const Card = ({ title, paragraph }: CardProps) => <aside>
	<h2>{ title }</h2>
	<p>
		{ paragraph }
	</p>
</aside>

const el = <Card title="Welcome!" paragraph="To this example" />
